pragma solidity  ^0.4.23;
pragma experimental ABIEncoderV2;

import './Accounts.sol';

contract Gratis is Accounts {
  mapping(address => mapping(bytes32 => uint)) public pendingDonations;

  event Donation(address donor, bytes32 nameHash, uint value);
  event PendingDonation(address donor, bytes32 nameHash, uint value);
  event PendingDonationCompleted(address donor, bytes32 nameHash, uint value);
  event PendingDonationRefunded(address donor, bytes32 nameHash, uint value);

  function donate(bytes32 nameHash) public payable {
    donateValue(nameHash, msg.value);
  }

  function donateToMany(bytes32[] nameHashes, uint[] values) public payable {
    uint i;
    uint totalValue;

    for (i=0; i<nameHashes.length; i++) {
      totalValue += values[i];
    }
    require( totalValue == msg.value );

    for (i=0; i<nameHashes.length; i++) {
      donateValue(nameHashes[i], values[i]);
    }
  }

  function withdrawPendingDonations(bytes32 nameHash, address[] donors) public {
    require( msg.sender == accounts[nameHash].owner );

    uint8 i;
    uint totalValue;
    for(i=0; i<donors.length; i++) {
      totalValue += pendingDonations[donors[i]][nameHash];
      emit PendingDonationCompleted(donors[i], nameHash, pendingDonations[donors[i]][nameHash]);
      returnTokens(nameHash, donors[i], pendingDonations[donors[i]][nameHash] / accounts[nameHash].weiPerToken);
      pendingDonations[donors[i]][nameHash] = 0;
    }
    accounts[nameHash].owner.transfer(totalValue);
  }

  function refundPendingDonation(bytes32 nameHash, uint value) public {
    require(  value <= pendingDonations[msg.sender][nameHash] );

    emit PendingDonationRefunded(msg.sender, nameHash, value);
    pendingDonations[msg.sender][nameHash] -= value;
    msg.sender.transfer(value);
  }

  function donateValue(bytes32 nameHash, uint value) internal {
    if (accounts[nameHash].owner != 0x0) {
      emit Donation(msg.sender, nameHash, value);
      accounts[nameHash].owner.transfer(value);
      returnTokens(nameHash, msg.sender, value / accounts[nameHash].weiPerToken);
    } else {
      emit PendingDonation(msg.sender, nameHash, value);
      pendingDonations[msg.sender][nameHash] += value;
    }
  }

  function returnTokens(bytes32 nameHash, address to, uint value) internal {
    accounts[nameHash].token.transferFrom(accounts[nameHash].owner, to, value);
  }

}
